INSERT INTO `work` VALUES (1546, 3876, '请人朗读《诺里斯先生换火车》', 30, 250, '2018-9-10 00:00:00', '2024-9-22 00:00:00', '希望你是男声（根据这本书中的第一人称），年龄在30-50 ， 还是根据本书的内容。 你负责买书，所以最好在大陆。 《诺里斯先生换火车》是著名作家克里斯托弗•伊舍伍德最知名的代表作，以冷静旁观之眼，描绘1930年代醉生梦死、充满末世情调的柏林城。 纳粹上台前夕，浩劫悄然降临。英国青年威廉在开往柏林的火车上结识了一位神秘而优雅的绅士诺里斯，故事围绕诺里斯先生身上的重重谜团展开。他披着光鲜的外衣游走在道德的灰色地带，负债累累却又出手阔绰，文质彬彬却又私下做些见不得光的事，为人胆小羞怯却又有性虐癖好。诺里斯身边聚', 1);
